import "./Expenses.css";
import ExpenseItem from "./components/ExpenseItem";

function Expenses(props) {
  const expenseItems = props.expenses.map((expense) => (
    <ExpenseItem
      date={expense.date}
      title={expense.title}
      amount="expense.amount"
    />
  ));

  return;
}

export default Expenses;
